import React, {useState} from 'react';
import './tasksTable.css';

function tasksTable() {

    return (
        <div className="tasks-table-container">
            <table className="tasks-table">
                <tr>
                    <th>#</th>
                    <th>Task</th>
                    <th>Points done</th>
                    <th>Points left</th>
                </tr>
            </table>
        </div>
    );
}

export default tasksTable;
